import { Component } from '@angular/core';
import { Animal } from '../model/animal.model';
import { AnimalService } from '../service/animal.service';
import { AdminlService } from '../service/admin.service';

@Component({
  selector: 'app-register-animal',
  templateUrl: './register-animal.component.html',
  styleUrls: ['./register-animal.component.css']
})
export class RegisterAnimalComponent {
  public user : Animal = new Animal();

  constructor(private adminService: AdminlService) { }

  ngOnInit(): void {
    console.log(localStorage.getItem('token'));

  }

  public getDate(): string {
    let date = new Date();
    let day = date.getDate();
    let month = date.getMonth() + 1;
    let year = date.getFullYear();
    return `${year}-${month < 9 ? ('0'+month) : month}-${day < 9 ? ('0'+day) : day}`;
  }

  register(){
    this.adminService.registerAnimal().subscribe((response: any) => {
      console.log(response)

      alert('Successfully registered');

      window.location.href = '/login-user'
    },
    (error) => {
      alert("Invalid registration");
      console.log(error);
    }
   );
  }
}
